import React from 'react';
import './home.css';
import * as firebase from 'firebase';


import LoginDone from './logindone';
import Login from './login';


function Logincheck()
{
  var finallog;
  alert("logincheck");

  firebase.auth().onAuthStateChanged(function(user) {
  if (user) {
    finallog = <LoginDone />
  } else {
    finallog = <Login />
  }
});

  return (
    <div>
      {finallog}
    </div>
  );


}

export default Logincheck;
